        <div style={{marginTop: 30, textAlign:'center'}}>
           <h1 style={{marginTop: 30, color:'red', textAlign:'center'}}><b>Forbidden !!</b></h1> <h4 style={{ marginTop:20, textAlign:'center'}}>You don't have permission to access this page.</h4>
           <img src='https://cdn.dribbble.com/users/134564/screenshots/4575057/kriptown-illu-animation403_clean.gif'
           style={{height: 300, width: 500, marginTop:30}}></img>
        </div>
    )
}

export default VendorScreen
